  <Auth0Provider
    domain="dev-0tubhb8u.us.auth0.com"
    clientId="ugV2NKXu3bQGs416Qf7rKQU99nPHd6KJ"
    redirectUri={window.location.origin}
>
  <App />
</Auth0Provider>,
document.getElementById('app')
);
